	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner) {
	    this.log = log      // I'm refering to the log variable which is present in the class and eqaul to log and second logis from constructor
	    this.context = context
	    this.testRunner = testRunner


	}


	    def sayHello(String name){
	    	   log.info ("   Hello "+name);
	    }
}

